import './App.css';
import React, { Component } from 'react';
import Header from './header.jsx';
import Sidebar from './sidebar';
import { Box } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';

class App extends Component {

  render() {

    return (
      <Box>
        <Box>
          <Header />
        </Box>
        <Box>
          <Sidebar />
        </Box>
      </Box>
    );
  } 
}

export default (App);
